import React from 'react';
import { List, Card } from 'antd';
import styled from 'styled-components';

const SkillList = styled.div`
  margin-top: 3rem;
`;

const Skill = () => {
  const data = [
    {
      title: 'React.js',
      img: <img src={require('../img/react.png')} />,
    },
    {
      title: 'Javascript',
      img: <img src={require('../img/Javascript.png')} />,
    },
    {
      title: 'CSS',
      img: <img src={require('../img/css.png')} />,
    },
    {
      title: 'Sass',
      img: <img src={require('../img/sass.png')} />,
    },
    {
      title: 'Git',
      img: <img src={require('../img/git.png')} />,
    },
    {
      title: 'node.js',
      img: <img src={require('../img/node.png')} />,
    },
    {
      title: 'Express',
      img: <img src={require('../img/express.png')} />,
    },
    {
      title: 'Jquery',
      img: <img src={require('../img/jquery.png')} />,
    },
    {
      title: 'MySQL',
      img: <img src={require('../img/mysql.png')} />,
    },
    {
      title: 'Azure',
      img: <img src={require('../img/azure.png')} />,
    },
  ];

  return (
    <SkillList>
      <h3>🔥 My SKILL</h3>
      <List
        grid={{ gutter: 16, column: 5 }}
        dataSource={data}
        renderItem={(item) => (
          <List.Item>
            <Card title={item.title}>{item.img}</Card>
          </List.Item>
        )}
      />
      ,
    </SkillList>
  );
};

export default Skill;
